import React from "react";

class Users extends React.Component {
    users = [
        {
            id: 1,
            firstname: 'Tolya',
            lastname: 'Stepanov',
            bio: 'asd',
            age: 23,
            isHappy: true
        },
        {
            id: 2,
            firstname: 'Jora',
            lastname: 'Dedyukin',
            bio: 'qwe',
            age: 24,
            isHappy: false
        },
        {
            id: 3,
            firstname: 'Alyona',
            lastname: 'Maximova',
            bio: 'zxc',
            age: 23,
            isHappy: true
        }
    ]
    render() {
        if(this.users.length > 0)
        return (<div>
            {this.users.map((el) => (<div className="user" key={el.id}>
                <h3>{el.firstname} {el.lastname}</h3>
                <p>{el.bio}</p>
                <b>{el.isHappy }</b>
                </div>))}
        </div>)
        else
        return (<div className=""user>
           <h3>Пользователей нет</h3>
        </div>)
    }
}

export default Users
